import React from 'react';
import {BrowserRouter as Router,Route}from "react-router-dom"
import "bootstrap/dist/css/bootstrap.min.css"
import ArcitectPage from './Pages/ArcitectPage.component'
//import LoginSignUp from './Pages/login-SignUp.component'
import Requset from'./Pages/Request.component'
function App() {
  return (
    <Router>
      {/* <Navbar/> */}
      <br/>
      <Route path="/"exact component={ArcitectPage}/>
      <Route path="/Requset"component={Requset}/>
    </Router>
  );
}

export default App;
